import React from 'react';

function Result({ result, openPopup }) {
    return (
        <div className="result" onClick={(e) => openPopup(result.imdbID, e)}>
            <img alt="" src={result.Poster} />
            <h3>{result.Title}</h3>

        </div>
    )
}

export default Result;
